            <img alt="" data-file-height="1223" data-file-width="900" decoding="async" height="163" src="//upload.wikimedia.org/wikipedia/commons/thumb/1/19/Benjamin_Netanyahu_2018.jpg/120px-Benjamin_Netanyahu_2018.jpg" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/1/19/Benjamin_Netanyahu_2018.jpg/180px-Benjamin_Netanyahu_2018.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/1/19/Benjamin_Netanyahu_2018.jpg/240px-Benjamin_Netanyahu_2018.jpg 2x" width="120"/>
